  margin: 0;
  position: relative;
  top: 50%;
  transform: translateY(-50%);
  width: 100%;
}

.pl-none-imp {
  padding-left: 0 !important;
}

.left-0 {
  left: 0 !important;
}

.page-max-width {
  max-width: 1200px;
}

.width-100 {
  width: 100%;
}

.height-100 {
  height: 100%;
}

.piece-shadow {
  box-shadow: 0 3px 5px -1px rgba(0, 0, 0, 0.2), 0 5px 8px rgba(0, 0, 0, 0.14),
    0 1px 14px rgba(0, 0, 0, 0.82);
}

.carousel-navigation-right .q-carousel__navigation-inner {
  display: flex;
  justify-content: flex-end;
}

.q-carousel__navigation-inner {
  z-index: 1;
  cursor: pointer;
}

.q-drawer--left.q-drawer--bordered {
  border-right: 1px solid rgba(0, 0, 0, 1);
}

.hide-expansion-toggle .q-item__section--side {
  display: none;
}

.form-textarea textarea {
  height: 80px !important;
  resize: none !important;
}

.fullscreen-active-btn i {
  font-size: 1.3em !important;
}

.piece-tag {
  z-index: 1;
  position: absolute;
  top: -2px;
  right: 0px;
  padding: 4px;
  border-bottom-left-radius: 7px !important;
}

.no-text-select {
  -webkit-touch-callout: none; /* iOS Safari */
  -webkit-user-select: none; /* Safari */ /* Konqueror HTML */ /* Old versions of Firefox */ /* Internet Explorer Edge */
  user-select: none; /* Non-prefixed version, currently
                                  supported by Chrome, Edge, Opera and Firefox */
}

/* TRANSITIONS */
.fade-enter-active,
.fade-leave-active {
  transition: opacity 0.5s;
}
.fade-enter, .fade-leave-to /* .fade-leave-active below version 2.1.8 */ {
  opacity: 0;
}

/* FONTS */

@font-face {
  font-family: Quicksand-SemiBold;
  src: url(fonts/Quicksand-SemiBold.ttf);
}

@font-face {
  font-family: Oswald-ExtraLight;
  src: url(fonts/Oswald-ExtraLight.ttf);
}

@font-face {
  font-family: Oswald-Light;
  src: url(fonts/Oswald-Light.ttf);
}

@font-face {
  font-family: Oswald-SemiBold;
  src: url(fonts/Oswald-SemiBold.ttf);
}

*:not(i) {
  font-family: "Oswald-Light";
  font-weight: 300;
}

*:not(i).text-weight-thin {
  font-family: "Oswald-ExtraLight";
  font-weight: 300;
}

*:not(i).text-weight-medium {
  font-family: "Oswald-SemiBold";
  font-weight: 300;
}

/* IMAGE ZOOM */
.img-zoom {
  display: inline-block;
  overflow: hidden; /* clip the excess when child gets bigger than parent */
}
.img-zoom .q-img {
  display: block;
  transition: transform 1.5s; /* smoother zoom */
}
.img-zoom.hovered-touched-style .q-img {
  transform: scale(1.2);
  transform-origin: 50% 50%;
}

/* CALENDAR */
.today-highlight {
  font-size: 20px !important;
  -webkit-text-decoration-line: underline;
          text-decoration-line: underline;
  font-weight: bold;
